import "./Button.css";

function Button(props) {

    const classNames = props.isButtonDisabled ? "btn-passive":"btn";
    return (
        <button
            onClick={props.downloadHandler}
            className={classNames}
            disabled={props.isButtonDisabled}
        >{props.text}</button>
    );
}

export default Button;
